import React from "react";
import PlannerSearcher from "./PlannerSearcher";

import Box from "@mui/material/Box";
import Paper from "@mui/material/Paper";

const UserWorkoutPlan = () => {
  return (
    <Box
      sx={{
        position: "relative",

        display: "flex",
        flexWrap: "wrap",
        "& > :not(style)": {
          m: 1,
          width: 800,
          height: 450,
        },
      }}
    >
      <Box>
        <PlannerSearcher />
      </Box>

      <Paper elevation={3} sx={{ bgcolor: "#2b627a" }} />
    </Box>
  );
};

export default UserWorkoutPlan;
